import { Morph } from "lively.morphic";
import { connect } from "lively.bindings/index.js";

export default class ScrummyContentEntry extends Morph {
  onLoad(){
    connect(this.get('saveButton'),'trigger',this,'save')
    connect(this.get('cancelButton'),'trigger',this,'cancel')
  }
  prepopBox(text) {
    this.get('textBody').textString = text ? text : 'Enter Content Here'
  }
  save(){
    if(!this.idx){
      this.target.addObj(this.get('textBody').textString)
    } else {
      this.target.updateObj(this.idx,this.get('textBody').textString)
    }    
    this.remove()
  }
  cancel(){
    this.remove()
  }

}
